import React from 'react';

const Reservations = ({ reservations, onDeleteReservation }) => {
    return (
        <div>
            <h2>Reservations</h2>
            <ul>
                {reservations.map((reservation) => (
                    <li key={reservation._id}>
                        <p>User: {reservation.username}</p>
                        <p>Accommodation: {reservation.accommodationName}</p>
                        <button onClick={() => onDeleteReservation(reservation._id)}>
                            Delete Reservation
                        </button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Reservations;
